import React from 'react';

const Footer = () => {
  return (
    <footer style={{ backgroundColor: '#f0f0f0', padding: '20px', textAlign: 'center' }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <div>
          <h4 style={{ margin: '0' }}>Title</h4>
          <p>Address</p>
        </div>
        <div>
          <p>
            <a href="/">Home</a> | <a href="/">Shop</a> | <a href="/">About</a> | <a href="/">Contact</a> | <a href="/">Help</a> | <a href="/">Payment Options</a> | <a href="/">Returns</a> | <a href="/">Privacy Policies</a> | <a href="/">Newsletter</a> | <a href="/">Email</a>
          </p>
        </div>
      </div>
      <p style={{ marginTop: '20px' }}>2023 MyFurniture. All rights reserved.</p>
    </footer>
  );
};

export default Footer;
